function Header() {
	return (
		<div
			className='image'
			style={{
				backgroundImage: `url(${img})`,
				height: "45rem",
				backgroundPosition: "-30px -80px",
				backgroundSize: "cover",
				backgroundRepeat: "no-repeat",
			}}
		></div>
	);
}

export default Header;
